import Link from 'next/link';
import React from 'react';
import Layout from '../components/MyLayout';

function App() {
  return (
    <Layout>
      <div className="App">
        <header className="App-header">
          {/* <img src={'https://img.pokemondb.net/artwork/bulbasaur.jpg'} className="App-logo"/> */}
          <p>
            Welcome to michaeldipaolo.com 
          </p>

          <Link href="/resume" title="Resume">
              <a>Continue to my resume</a>
          </Link>

        </header>
      </div>
    </Layout>
  );
}

export default App;
